import Text from "../components/Text";

export default function Index() {
  return (
    <React.StrictMode>
      <Text>
        Gooday !! I am <span>Damengradom</span>, who is a web developer, you can find me from Github.
      </Text>
      <Text>My side projects:</Text>
      <Text><a href="https://whichi.netlify.app/" target="_blank">Whichi</a></Text>
      <Text>and</Text>
      <Text><a href="https://dm-tipify.netlify.app/" target="_blank">Tipify</a></Text>
    </React.StrictMode>
  )
};
